import React from 'react';
import './css/Home.css';

function Home() {
    return (
        <div className="hero-image">
            <div className="hero-profile"></div>
            <div className="hero-text">
                <h3>Hello, I'</h3>
                <h1>David Mah</h1>
                <p>- Software Engineer -</p>
            </div>
        </div> 
    )
}

export default Home;
